class Solution:    def subdomainVisits(self, cpdomains):        """        :type cpdomains: List[str]        :rtype: List[str]        """        dict={}        for item in cpdomains:            number,web=int(item.split()[0]),item.split()[1]            webs=web.split(".")            str1=""            for j in range(len(webs)-1,-1,-1):                if j ==len(webs)-1:                    str1+=webs[j]                else:                    str1=webs[j]+"."+str1                if str1 not in dict:                    dict[str1]=number                else:                    dict[str1]+=number        ans=[]        for (item,number)in dict.items():            ans.append(str(number)+" "+item)        return anscpdomains=["900 google.mail.com", "50 yahoo.com", "1 intel.mail.com", "5 wiki.org"]s=Solution()print(s.subdomainVisits(cpdomains))